import React from 'react'
import ReactDOM from 'react-dom'
import ComponentDetails from './ComponentDetails'
import ApprovalCard from './ApprovalCard'

const App = () => {
    return (
        <div className="ui container comments">
            <ApprovalCard> 
                <ComponentDetails author="sam" timeAgo="Today At 7:00PM"/>
            </ApprovalCard>
            <ApprovalCard>
                <ComponentDetails author="alex" timeAgo="Today At 2:00PM"/>
            </ApprovalCard>         

            <ApprovalCard > 
                <ComponentDetails author="jane" timeAgo="Yesterday at 5:00 PM"/>
            </ApprovalCard>
        </div>
    ); 
};

ReactDOM.render(<App/>,document.querySelector('#root'));
